import React from 'react';

const Mascot = ({ highlightedProperties, onClick }) => {
  return (
    <div className="mascot-container">
      <img src="/mascot.png" alt="Mascot" className="mascot-image" />
      <div className="properties-list">
        {highlightedProperties.map((property) => (
          <div key={property.id} className="property-item" onClick={() => onClick(property)}>
            <h3>{`Property ID: ${property.id}`}</h3>
            <p>{`Price: ${property.Price} CAD`}</p>
            <p>{`Rooms: ${property.Rooms}`}</p>
            <p>{`Bathrooms: ${property.Number_of_Bathrooms}`}</p>
            <p>{`Area: ${property.area}`}</p>
            <p>{`Builder: ${property.Builder}`}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Mascot;
